import React from 'react';

class RestaurantInfo extends React.Component {
  render(){
    return(
      <div>
        <span>Restaurant Name</span>
        <span>Address</span>
        <span>Phone Number</span>
        <span>Hours</span>
      </div>
    )
  }
}

export default RestaurantInfo;
